  events = events.withStatuses(["performed"]);
  events = events.withoutNegation();
  var codes = getCodes("1.3.6.1.4.1.33895.1.3.0.31");
  var start = null;
  var end = null;
  events = events.match(codes, start, end, true);

  events.specificContext=new hqmf.SpecificOccurrence(Row.buildForDataCriteria(events.specific_occurrence, events))
